def gnomADQueryFunction(Item, TabixObj):
	TabixOutput = TabixObj.query(Item[0], Item[1] - 1, Item[1])
	Result = [ gnomADParseLine(Row = Row) for Row in TabixOutput if VcfVariantMatch(Item = Item, Row = Row) ]
	BriefDetails = { "gnomAD": None if not Result else [item['ID'] for item in Result], "gnomAD_Details": None if not Result else Result }
	return BriefDetails
